        return product;
      } else if (product.city.toLowerCase().includes(search.toLowerCase())) {
        return product;
      }
    });

    setSearchValue(filterProduct);
  };
  return (
    <div style={{ paddingTop: "60px", paddingBottom: "60px" }}>
      <div>
        <div></div>
        <div>
          <div>
            <label htmlFor="destination" className="opacity-70 block">
              <div className="w-full flex justify-between items-center">
                <p>Max Price</p>
                <p className="font-bold text-xl">$ {priceValue}</p>
              </div>
            </label>
            <div className=" bg-gray-100 rounded-full p-2 flex items-center justify-center ">
              <input
                type="range"
                name="destination"
                id="destination"
                className="appearance-none w-full bg-gradient-to-r from-primary to-secondary h-2 rounded-full my-2"
                min="150"
                max="1000"
                value={priceValue}
                step="10"
                onChange={(e) => setPriceValue(e.target.value)}
              />
            </div>
          </div>
        </div>
      </div>
      <div>
        <iframe
          src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d242117.70906659198!2d73.69815111553402!3d18.524870612981903!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3bc2bf2e67461101%3A0x828d43bf9d9ee343!2sPune%2C%20Maharashtra!5e0!3m2!1sen!2sin!4v1716360540118!5m2!1sen!2sin"
          width="600"
          height="450"
          style={{ border: "0" }}
          allowfullscreen=""
